import com.cloudera.sparkts.api.java._
import com.cloudera.sparkts.TimeSeriesRDD
import com.cloudera.sparkts.DateTimeIndex
import com.cloudera.sparkts.HourFrequency
import com.cloudera.sparkts.MinuteFrequency
import java.time.{LocalDateTime, ZoneId, ZonedDateTime}

val zone = ZoneId.systemDefault()

val dtIndex = DateTimeIndex.uniform( 
        ZonedDateTime.of(LocalDateTime.parse("2018-01-01T00:00:00"), zone), // Start window at January 1, 2018
        24*30*60, //Number of Periods
        new MinuteFrequency(1))  // Every 30 minutes will be an index

val siteTSrdd = TimeSeriesRDD.timeSeriesRDDFromObservations(dtIndex, modifiedDF1.filter("timestamp is not null"), "timestamp", "site", "value") 
// dtIndex      -   DateTimeIndex to conform all the series to.
// df           -   The DataFrame.
// tsCol        -   The Timestamp column telling when the observation occurred.
// keyCol       -   The string column labeling which string key the observation belongs to..
// valueCol     -   The observed value..

siteTSrdd.cache()
siteTSrdd.count()
siteTSrdd.take(1)

//Fill Empty Values
val filledsiteTSrdd = siteTSrdd.fill("linear")

filledsiteTSrdd.take(1)

val filledSiteDF = filledsiteTSrdd.toObservationsDataFrame( spark.sqlContext, "timestamp", "site", "value")
// sqlContext: SQLContext
// tsCol: String = "timestamp"
// keyCol: String = "key"
// valueCol: String = "value"

filledSiteDF.cache()
filledSiteDF.take(10)
filledSiteDF.createOrReplaceTempView("Interpolation")

%angular

<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.5/leaflet.css" />
<div id="map" style="height: 500px; width: 100%"></div>

<script type="text/javascript">
function initMap() { 		
    var map = L.map('map').setView([31.150, -104.810], 6);
    L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png').addTo(map);
    var geoMarkers = L.layerGroup().addTo(map);

    var RedIcon = L.icon({
    iconUrl: 'https://mt.googleapis.com/vt/icon/name=icons/onion/123-red-dot.png',
    iconSize: [32, 32],
    });

    var BlueIcon = L.icon({
    iconUrl: 'https://mt.googleapis.com/vt/icon/name=icons/onion/22-blue-dot.png',
    iconSize: [32, 32],
    });

    var el = angular.element($('#map').parent('.ng-scope'));
    angular.element(el).ready(function() {
        window.locationWatcher = el.scope().compiledScope.$watch('SiteLocations1', function(newValue, oldValue) {
            geoMarkers.clearLayers();
            angular.forEach(newValue, function(event) {
                if (event){
                    var marker = L.marker([event.values[0], event.values[1]], {icon: BlueIcon}).bindPopup("Site: " + event.values[2]).addTo(geoMarkers);
                }
            });
        })
    });

}

if (window.locationWatcher) { window.locationWatcher(); }

// ensure we only load the script once, seems to cause issues otherwise
if (window.L) {
    initMap();
} else {
    console.log('Loading Leaflet library');
    var sc = document.createElement('script');
    sc.type = 'text/javascript';
    sc.src = 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.5/leaflet.js';
    sc.onload = initMap;
    sc.onerror = function(err) { alert(err); }
    document.getElementsByTagName('head')[0].appendChild(sc);
}
</script>
